import './App.css';
import {Box, Button, Typography} from "@mui/material";
import tubeImage from "./static/Tube.png"
import {useState} from "react";

function App() {
    const [open, setOpen] = useState(false);
    const message = "업데이트 요청됌.";

    const handleOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    return (
        <div className="App">
            <header className="App-header">
                <Box width={"80%"} height={"auto"} display={"flex"} justifyContent={"center"} alignItems={"center"}>
                    <img src={tubeImage} alt={"튜브 따봉 이미지"} width={"80%"}/>
                </Box>

                <Box width={"90%"} height={"auto"} marginBottom={2}>
                    <Typography fontSize={12}>
                        마지막 업데이트:
                    </Typography>
                    <Typography fontSize={12}>
                        2024-06-07 14시 32분
                    </Typography>
                </Box>

                <Box marginBottom={2}>
                    <Button variant={"contained"} onClick={handleOpen}>
                        수동 업데이트
                    </Button>
                </Box>
            </header>

            {open && (
                <div className="dialog-overlay">
                    <div className="dialog-content">
                        <Typography>{message}</Typography>
                        <Button variant={"contained"} onClick={handleClose}>
                            수동 업데이트
                        </Button>
                    </div>
                </div>
            )}
        </div>
    );
}

export default App;
